"use strict";

var URI = require('urijs'),
    Identified = require('./Identified'),
    util = require('./util');

/**
 * Class to represent an SBOL2 Range location.
 */
class Range extends Identified
{
    constructor(sbolDocument, uri) {

        super(sbolDocument, uri);

        this._start = 0;
        this._end = 0;
        this._orientation = URI('');
        this._sequence = URI('');
    }

    /**
     * Set the start property for this Range.
     * @param {Integer} [start]
     */
    set start(start) {
        this._start = start;
    }

    /**
     * Retrieve the start property for this Range.
     * @returns {Integer}
     */
    get start() {
        return this._start;
    }

    /**
     * Set the end property for this Range.
     * @param {Integer} [end]
     */
    set end(end) {
        this._end = end;
    }

    /**
     * Retrieve the end property for this Range.
     * @returns {Integer}
     */
    get end() {
        return this._end;
    }

    /**
     * Set the orientation property for this Range.
     * @param {string|URI} [orientation]
     */
    set orientation(orientation) {
        this._orientation = util.uriOrObject(orientation);
    }

    /**
     * Retrieve the orientation property for this Range.
     * @returns {URI}
     */
    get orientation() {
        return this._orientation;
    }

    /**
     * Set the Sequence for this location.
     * @param {string|URI|Sequence} [sequence]
     */
    set sequence(sequence) {
        this._sequence = util.uriOrObject(sequence);
    }

    /**
     * Retrieve the Sequence for this location.  Returns either a
     * URI or a Sequence, depending on whether the URI has been
     * resolved by link().
     *
     * @returns {URI|Sequence}
     */
    get sequence() {
        return this._sequence;
    }

    link() {
        this._sequence = this._sbolDocument.lookupURI(this._sequence);
    }
}

module.exports = Range;

